import React, { Component } from 'react';
import Chart from './Chart';
class App extends Component{
    constructor(props){
        super(props);
        this.state={
            chartData:{}
        }
    }
    componentWillMount(){
        this.getchartData();
    }
    async getchartData(){
        //Ajax Calls here
        await fetch('https://datausa.io/api/data?drilldowns=Nation&measures=Population')
            .then(res=>res.json())
            .then(res=>this.setState({chartData:{apiResponse:res}}))
    }
    render(){
        return(
            <div className="App">
                <div className="App-header">
                    <h2>Dashboard</h2>
                </div>
                <Chart chartData={this.state.chartData}/>
            </div>
        );
    }
}
export default App;
